    false,nt"url": null,nt"notes": "This dataset consists of video transect
    images (TIF files) from CRAMP surveys taken in 2000 at 23 sites, some of which had
    multiple depths. Estimates of substrate type, rugosity, species type, and percent
    coverage were provided to the NOAA data system within a separate data set. The video
    images are important for future researchers to resolve any question about how the
    image data were interpreted for the quantitative database, to provide the opportunity
    to re-analyze the images using other methods, and to return to the same locations
    for future comparisons.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
